The current definition of a Tari UTXO is: pub struct TransactionOutput { /// Options for an output's structure or use features: OutputFeatures, /// The homomorphic commitment representing the output amount commitment: Commitment, /// A proof that the commitment is in the right range proof: RangeProof,
} Note: Currently, the output features are actually malleable. TariScript fixes this. Under TariScript, this definition changes to accommodate the script and the sender offset public keys: pub struct TransactionOutput { /// Options for an output's structure or use features: OutputFeatures, /// The homomorphic commitment representing the output amount commitment: Commitment, /// A proof that the commitment is in the right range proof: RangeProof, /// The serialised script script: Vec<u8>, /// The sender offset pubkey, K_O sender_offset_public_key: PublicKey /// UTXO signature signing the transaction output data and the homomorphic commitment with a combination /// of the homomorphic commitment private values (amount and blinding factor) and the sender offset private key. metadata_signature: CommitmentAndPublicKeySignature,
} The commitment definition is unchanged: $$ \begin{aligned} C_i = v_i \cdot H + k_i \cdot G \end{aligned} \tag{1} $$ The metadata signature is a combined commitment and public key signature signed with the private values of the commitment \( (v_i \, , \, k_i )\) known by the receiver, and sender offset private key \(k_{Oi}\), only known by the sender. The signature challenge consists of all the transaction output metadata, effectively forming a contract between the sender and receiver, making all those values non-malleable and ensuring only the sender and receiver can enter into this contract. (See this PR for more details on this representation proof.) Note that: The UTXO has a positive value \( v \) like any normal UTXO. The script and the output features can no longer be changed by the miner or any other party. This includes the sender and receiver; they would need to cooperate to enter into a new contract to change any metadata, otherwise the metadata signature will be invalidated. We provide the complete script on the output.

